		axios
			.get(`https://cms.meamacollect.ge/meama-collect/api/client/ka/${id}`)
			.then((getData) => {
				setProductDetail(getData.data);
				console.log(getData.data);
			});
	}, [id]);
  return (
    <div>
       <Products productDetail={productDetail}/>
